import React, {useState} from 'react';
import './Sales.css'
import {connect} from 'react-redux';
import * as actions from '../actions/pos';








function Sales_preview(props){

    return(
        <>

        {props.poslist.map((record, index) => {
            return (<ul id="Preview" key={index}>
                <li>{record.Password}</li>
                <li>{record.UserID}</li>
                <li>{record.UserLogin_DateTime}</li>
                <li>{record.UserName}</li>
                <li>{record.UserType}</li>
            </ul>);
        })}
        <ul class="list-group">
  <li className="list-group-item d-flex justify-content-between align-items-center">
    A list item
    <span className="badge bg-primary rounded-pill">14</span>
  </li>
  <li className="list-group-item d-flex justify-content-between align-items-center">
    A second list item
    <span className="badge bg-primary rounded-pill">2</span>
  </li>
  <li className="list-group-item d-flex justify-content-between align-items-center">
    A third list item
    <span className="badge bg-primary rounded-pill">1</span>
  </li>
</ul>
</>
    );
}


actions.TableString.StringOfTable="UserLogin";
const mapStateToProps = state=>({
        poslist: state.pos.list  
})

const mapActionToProps =  {
    fetchAllPos: actions.fetchall
}

export default connect(mapStateToProps,mapActionToProps)(Sales_preview);
